  const [isSignup   ,setIsSignup] = useState(false)
  return (
    <section className='auth-section'>
      <div className='auth-container'>
            {!isSignup && <img src={icon} alt='doubt' className='login-logo'></img>}
            <form >
              <label htmlFor="">
                <h4>Email</h4>
                <input type="email"  />
              </label>
            </form>
      </div>
    </section>
  )
}

export default Auth
